import React from 'react';
import { StyleSheet, Text, View ,Image,Button,Icon,TextInput} from 'react-native';
import main from '../assets/main.png'; 



const style = StyleSheet.create({
  container: {
    flex: 1,
  },
  slideContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
 
});
 
 class Reg  extends React.Component {
  render() {
    return (
      
      <View style={{flex:'end',flexDirection:'row-reverse'}}  >
         <View>
             <Text style={{fontSize: 42 ,fontStyle:'italic'}}  > Book Your Appointment

             </Text>

          <Image source={main} style={{width: '20%', height: '100px' }} />    
          <Image source={main} style={{width: '20%', height: '100px' }} />    
          <Image source={main} style={{width: '20%', height: '100px' }} />    
         </View>
     
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width:'60%',
  
  },
  slideContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    
  },
 
});
export default Reg;
